import Profile from "./component/profile";

import Linker from "./component/links";
import "./links.css";
import Socials from "./component/socials";
import "./social.css";
import Share from "./component/share";
import "./share.css";

const Home = () => {
  return (
    <div>
      <Share />
      <Profile />
      <Linker />
      <Socials />
    </div>
  );
};

export default Home;
